import { Container, Row } from 'reactstrap';
import Dashboard from './layouts/Dashboard';
import JobAdvertisement from './layouts/JobAdvertisement';
import Navigation from './layouts/Navigation';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Navigation/>
        </Row>
        <Row>
           <JobAdvertisement/>
        </Row>
      </Container>

    <Dashboard/>

    </div>
  );
}

export default App;
